import React from "react";
import { Section, Icons, IconOne } from "./FooterElements";
import { FaChartLine } from "react-icons/fa";

function Footer() {
  return (
    <Section>
      <Icons>
        <IconOne>
          <FaChartLine />
          <p>Monitor</p>
        </IconOne>
      </Icons>
    </Section>
  );
}

export default Footer;
